import React, { useEffect, useState } from "react";
import axios from "axios";
import { motion } from "framer-motion";
import { toast } from "react-toastify";
import { useLocation, useNavigate } from "react-router-dom";

// Orders component
const Orders = () => {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchOrders = async () => {
      try {
        const response = await axios.get("http://localhost:5000/api/orders");
        setOrders(response.data);
      } catch (err) {
        console.error("Error fetching orders:", err);
        toast.error("Failed to load orders.");
      } finally {
        setLoading(false);
      }
    };

    fetchOrders();
  }, []);

  if (loading) {
    return (
      <div className="text-center py-20">
        <p className="text-gray-600 text-xl">Loading orders...</p>
      </div>
    );
  }

  if (!orders || orders.length === 0) {
    return (
      <div className="text-center py-20">
        <p className="text-gray-600 text-xl">No orders have been placed yet.</p>
      </div>
    );
  }

  return (
    <div className="bg-[#fff3eb] py-10 px-6 sm:px-12 lg:px-20">
      <h1 className="text-3xl sm:text-4xl font-bold text-center mb-10 text-[#e96610]">All Orders</h1>
      <div className="space-y-8">
        {orders.map((order) => {
          const isDelivered = Math.random() < 0.5; // Simulate delivery status for demonstration

          return (
            <motion.div
              key={order._id}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5 }}
              className="bg-white p-6 rounded-xl shadow-md border border-gray-200"
            >
              <div className="flex justify-between items-center mb-4 border-b pb-4">
                <h2 className="text-xl font-bold text-gray-800">
                  Order ID: <span className="text-sm font-normal text-gray-600">{order._id}</span>
                </h2>
                <span className="text-sm text-gray-500">
                  {new Date(order.createdAt).toLocaleDateString()}
                </span>
              </div>
              <div className="space-y-4">
                {order.items.map((item, index) => (
                  <div key={index} className="flex items-center gap-4">
                    <img
                      src={item.image}
                      alt={item.name}
                      className="w-16 h-16 rounded-lg object-cover"
                    />
                    <div className="flex-1">
                      <p className="font-semibold text-gray-700">
                        {item.name} <span className="text-gray-500">x{item.quantity}</span>
                      </p>
                      <p className="text-sm text-gray-600">${Number(item.price).toFixed(2)} each</p>
                    </div>
                    <p className="font-bold text-gray-800">${(item.price * item.quantity).toFixed(2)}</p>
                  </div>
                ))}
              </div>
              <div className="mt-6 pt-4 border-t flex justify-between items-center">
                <p className="text-lg font-bold">
                  Total: <span className="text-orange-500">${Number(order.totalPrice).toFixed(2)}</span>
                </p>
                <span
                  className={`py-1 px-3 rounded-full text-sm font-medium ${
                    isDelivered ? "bg-green-100 text-green-700" : "bg-yellow-100 text-yellow-700"
                  }`}
                >
                  {isDelivered ? "Delivered" : "Delivering"}
                </span>
              </div>
            </motion.div>
          );
        })}
      </div>
    </div>
  );
};

export default Orders;
